import Name from './Component/Name';
function App() {
  return (
    <div className="App">
    <Card style={{ width: '20rem' , backgroundColor:'black',color:'white'}}>
        <Image />  
      <Card.Body>
        <Card.Title>Nom:<Name />. Prix:<Prix /></Card.Title>
        <Card.Text>
          < Description />
        </Card.Text>

      </Card.Body>
    </Card>

    </div>
  );
}

export default App;
